import React, {Component} from 'react';

class App extends Component {

    constructor(props) {
        super(props);
        this.state= {
            items: [],
            isLoaded: false,
        }
    }

    componentDidMount() {

        fetch('https://opendata.paris.fr/api/v2/catalog/datasets/que-faire-a-paris-?pretty=false&timezone=UTC&include_app_metas=false')
            .then(res => res.json())
            .then(json => {
                this.setState({
                    isLoaded: true,
                    items: json,
                })
            });

    }

}

function Accueil(props) {   




    return (
        <div>
            <h1>Bienvenue sur Paris Events</h1>
            <p>L'application qui permet de rechercher en direct les prochains événements Parisiens</p>
        </div>
    );
}

export default Accueil;
